import React from 'react';

const InitialPopup = ({ language, setLanguage, onClose }) => (
  <div className="initial-popup">
    <h2>{language === 'english' ? 'Welcome to the Test' : 'टेस्ट में आपका स्वागत है'}</h2>
    <p>{language === 'english' ? 'Choose your preferred language:' : 'अपनी पसंदीदा भाषा चुनें:'}</p>
    <button onClick={() => setLanguage('english')}>English</button>
    <button onClick={() => setLanguage('hindi')}>हिंदी</button>
    <button onClick={onClose}>Start</button>
  </div>
);

export default InitialPopup;
